  axis.text = element_text(size = 14),\n","    legend.title = element_text(size = 20),\n","    legend.text = element_text(size = 16)\n","  )\n","\n","options(repr.plot.width = 20, repr.plot.height = 10)\n","ggplot(train, aes(x = index(train), y = GOOG.Adjusted)) +\n","  geom_line() +\n","  labs(title = \"Google Stock Price\",\n","       x = \"Date\",\n","       y = \"Price\") +\n","  theme"]},{"cell_type":"markdown","id":"3e99cc16","metadata":{"papermill":{"duration":0.008781,"end_time":"2024-04-19T17:48:45.27914","exception":false,"start_time":"2024-04-19T17:48:45.270359","status":"completed"},"tags":[]},"source":["## Diagnosing heteroskedasticity"]},{"cell_type":"markdown","id":"cf3fc251","metadata":{"papermill":{"duration":0.008274,"end_time":"2024-04-19T17:48:45.296046","exception":false,"start_time":"2024-04-19T17:48:45.287772","status":"completed"},"tags":[]},"source":["The returns and log-returns of a time series are *stationary* and *ergodic*. Stationarity implies that the statistical properties of the series, such as mean and variance, remain constant over time. Ergodicity suggests that the long-term statistical behavior of the series can be inferred from a single, sufficiently long sample. Therefore, by focusing on returns, which capture the percentage change in asset prices over time, we mitigate potential biases arising from non-stationarity and achieve a more stable representation of the underlying dynamics.\n","\n","In this case our attention turns to the assessment of *heteroskedasticity*, which refers to the phenomenon where the variability of the data changes over time. We must detect heteroskedasticity in order to determine that an ARCH model is necessary. We can employ a hypothesis test to ascertain whether heteroskedasticity is present in the log-returns series; in this case, we expect it to be, as this is very common for financial data."]},{"cell_type":"code","execution_count":4,"id":"e7d25ee4","metadata":{"execution":{"iopub.execute_input":"202