n ARMA+eGARCH model selected by BIC\"\n","    ),\n","    caption = \"Data from Yahoo Finance\",\n","    x = \"\",\n","    y = \"Value\"\n","  ) +\n","  ylim(c(0.75*min(test$GOOG.Adjusted), 1.25*max(test$GOOG.Adjusted))) +\n","  scale_x_date(date_labels = \"%Y-%m\", date_breaks = \"1 month\") +\n","  theme"]},{"cell_type":"markdown","id":"b6da219d","metadata":{"papermill":{"duration":0.031306,"end_time":"2024-04-19T17:49:52.198579","exception":false,"start_time":"2024-04-19T17:49:52.167273","status":"completed"},"tags":[]},"source":["The model's predictions exhibit a phenomenon where the spread of outcomes is relatively narrow at the beginning of the forecast horizon but gradually widens as time progresses. This pattern reflects the inherent uncertainty and volatility present in financial markets, where short-term predictions may have comparatively lower variability but long-term forecasts are subject to a wider range of potential outcomes. Understanding and accounting for this widening spread is crucial for risk management and decision-making in financial modeling and investment strategies. Consequently, the model should be updated frequently, allowing for adjustments to reflect evolving market conditions and ensuring the reliability of forecasts over time.\n","\n","With that said, it's observed that the real stock prices generally correspond to their expected predictions generated by the ARMA + eGARCH model, except for a notable deviation between mid January and mid February. This discrepancy underscores an important aspect of the model's limitations: its inability to detect short-term large variations in stock prices accurately. However, it's essential to recognize that stock prices commonly exhibit a long-term trend that is often disconnected from their short-term fluctuations; as such, the model does provide valuable insights into long-term patterns and volatility dynamics.\n","\n","For those curious on what happened between January and March, this is the time frame where \"stocks moved higher again as investors wait for Wednesday’s likely interest rate hike announcement from the Federal Reserve\", according to CNN Business [5], and then \"Alphabet shares dive after Google AI chatbot Bard flubs answer in ad\", according to Reuters [6]. These events exemplify the dynamic and unpredictable nature of the financial market, where factors beyond traditional modeling parameters can exert substantial impacts on stock prices. Such occurrences underscore the inherent challenge of incorporating all relevant variables into predictive models and highlight the importance of staying abreast of current events and market sentiment for effective decision-making in financial markets.\n","\n","An intriguing aspect worth noting is that despite the downward trend in the stock price since 2022, the model predicted a rise in the stock price for 2023, and remarkably, this prediction turned out to be correct. This instance underscores the model's potential to capture long-term shifts or reversals in stock price movements, even amidst prevailing trends."]},{"cell_type":"markdown","id":"e2124fbb","metadata":{"papermill":{"duration":0.030489,"end_time":"2024-04-19T17:49:52.259392","exception":false,"start_time":"2024-04-19T17:49:52.228903","status":"completed"},"tags":[]},"source":["# Predicting values"]},{"cell_type":"markdown","id":"ae42c57e","metadata":{"papermill":{"duration":0.030474,"end_time":"2024-04-19T17:49:52.320456","exception":false,"start_time":"2024-04-19T17:49:52.289982","status":"completed"},"tags":[]},"source":["We can also use the model to calculate the propability that the stocks will reach a certain price on a certain time frame by checking how many of the simulations got to this price. For example, let's see if the model expects that at any point of 2023, the price will reach US$100."]},{"cell_type":"code","execution_count":12,"id":"756a44e5","metadata":{"execution":{"iopub.execute_input":"2024-04-19T17:49:52.385504Z","iopub.stat